import React, {Fragment, useState} from 'react';
import "../index.css"
import { useForm } from 'react-hook-form';


const axios = require('axios');

function Inscription() {
        const [state, setpost] = useState();
        const {
            register,
            handleSubmit,
            formState: { errors },
          } = useForm();
          const onSubmit = (data) => {
            const resultat={
              login:data.login,
              email:data.email,
              password:data.password,
              passwordConfirm:data.passwordConfirm,
            };
            axios.post(`http://localhost:4242/register`,resultat)
              .then(res => {
                console.log(res);
                //console.log(res.data);
                setpost(res.data)
              })

          };

      return (
        <React.Fragment>
        <form onSubmit={handleSubmit(onSubmit)}>
        login
        <input {...register('login')} /> {/* register an input */}
        email<input {...register('email', { required: true })} />
        password<input {...register('password', { required: true })} />
        passwordConfirm<input {...register('passwordConfirm', { required: true })} />
        <input type="submit" />
      </form>
      <p></p>
      <Router>
        <div>

          <nav className="navbar navbar-expand-lg navbar-light bg-light">
          <ul className="navbar-nav mr-auto">
            <li><Link to={'/'} className="nav-link"> Home </Link></li>
            <li><Link to={'/contact'} className="nav-link">Contact</Link></li>
            <li><Link to={'/login'} className="nav-link">Login</Link></li>
            <li><Link to={'/inscription'} className="nav-link">{state}</Link></li>
          </ul>
          </nav>
          <hr />
          <Switch>
              <Route exact path='/' component={Home} />
              <Route path='/contact' component={Contact} />
              <Route path='/login' component={Login} />
              <Route path='/inscription' component={Inscription} />
          </Switch>
        </div>
      </Router>   
      </React.Fragment>
      );
  }

  export default Inscription;
